window.bookSummaryJSON = "<p><b>One week. Just one more week.</b></p> <p>Inmate 5313 reached the end of his sentence after 10 grueling years. That is, until the wrong question led to a beating with an exclusive stay in the fridge.</p> <p>Before the badges manage to lock him into cryostorage for a nightmare-fueled nap, several explosions send the prison barge plummeting into a frozen planet in unclaimed space.&nbsp;</p> <p>This is the first day of Sebâ€™s freedom, an ill-starred future that includes banding together with cutthroat mercenaries, bartering with sordid information brokers, and fighting against the galaxy's ruthless corporations.</p> <p>He'll fight tooth and nail to fulfill his lifelong dream of building his own ship. But what's a ship without a crew? In a galaxy where everyone carries a blaster, Seb will need to find people he trusts.</p> <p><b>This book contains explicit content and unconventional relationships.</b></p>"; 
